import React from "react";
import { useState, useEffect } from "react";

function Codeforces() {
  const [user, setuser] = useState([]);

  const getUser = async () => {
    const respone = await fetch(
      `https://codeforces.com/api/user.rating?handle=Hustlingbeast_Anish`
    );
    setuser(await respone.json());
  };

  useEffect(() => {
    getUser();
  }, []);

  return (
    <>
      <div>
        <h2>Codeforces Stats</h2>
        <div className="container-fluid mt-5"></div>
      </div>
    </>
  );
}

export default Codeforces;
